import React from "react";
import linkedin from './linkedin.jfif';

const FooterPage = () => {
    return (
        <div class="d-flex flex-column">
            <footer class="footer">
                <div>
                    <a href="www.linkedin.com/in/anthony-considine-03486056/" ><img src={linkedin} width="25" height="25" class="rounded float-right"></img>&emsp;</a>
                    <span class="rounded float-left">&emsp; &copy; 2021 AnthonyConsidine</span>
                </div>
            </footer>
        </div>
    );
}

export default FooterPage;
